function Header(props) {
    const styles = {
        longButton: {
            width: '100%',
            display: 'flex',
            marginTop: '3%',
            marginBottom: '7%',
            textAlign: 'center'
        },
        success: {
            textAlign: 'center',
            marginTop: '3%',
            marginBottom: '7%',
            textAlign: 'center',
            color: 'rgba(255, 255, 255, 0.856)'
        }

    }


    return (

        <header>

            <section>
                <img src="/UntitledTwo.png" alt="Yellow duck" />
                <h1>RubberDucks</h1>
                <img src="/Untitled.png" alt="Yellow duck" />
            </section>
            <h2>The Bird enthusiasts page</h2>
            <h2>{props.brand}</h2>

            <nav>
                <button onClick={() => props.setPage('home')}>Return Home</button>
                <button onClick={() => props.setPage('search')}>Search for a species</button>
                <button onClick={() => props.setPage('form')}>Submit a sighting</button>
            </nav>

        </header>

    )
}

export default Header;
